import React, { useEffect, useState } from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, PieChart, Pie, Cell, LineChart, Line } from 'recharts';
import { Grid, Paper, Typography, CircularProgress } from '@mui/material';

// Define colors directly
const CHART_COLORS = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042', '#8884d8'];

const TaskAnalytics = ({ username }) => {
  const [analyticsData, setAnalyticsData] = useState(null);
  const [loading, setLoading] = useState(true);
  const API_BASE_URL = 'http://localhost:5000/api';

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(`${API_BASE_URL}/users/${username}/task-analytics`);
        if (!response.ok) throw new Error('Failed to fetch analytics');
        const data = await response.json();
        setAnalyticsData(data);
      } catch (error) {
        console.error('Error fetching analytics:', error);
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, [username]);

  if (loading) return <CircularProgress />;

  return (
    <Grid container spacing={3} sx={{ mt: 2 }}>
      {/* Tasks per Area Chart */}
      <Grid item xs={12} md={6}>
        <Paper sx={{ p: 2 }}>
          <Typography variant="h6" gutterBottom>
            Tasks Completed by Area
          </Typography>
          <BarChart width={500} height={300} data={analyticsData.tasksByArea}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="area_name" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Bar dataKey="task_count" fill="#1976d2" name="Tasks Completed" />
          </BarChart>
        </Paper>
      </Grid>

      {/* Difficulty Distribution */}
      <Grid item xs={12} md={6}>
        <Paper sx={{ p: 2 }}>
          <Typography variant="h6" gutterBottom>
            Difficulty Distribution
          </Typography>
          <PieChart width={500} height={300}>
            <Pie
              data={analyticsData.difficultyDistribution}
              dataKey="count"
              nameKey="difficulty_level"
              cx="50%"
              cy="50%"
              outerRadius={80}
              label
            >
              {analyticsData.difficultyDistribution.map((entry, index) => (
                <Cell key={`cell-${index}`} fill={CHART_COLORS[index % CHART_COLORS.length]} />
              ))}
            </Pie>
            <Tooltip />
            <Legend />
          </PieChart>
        </Paper>
      </Grid>

      {/* Processing Time Trend */}
      <Grid item xs={12}>
        <Paper sx={{ p: 2 }}>
          <Typography variant="h6" gutterBottom>
            Average Processing Time by Area
          </Typography>
          <LineChart width={800} height={300} data={analyticsData.tasksByArea}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="area_name" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Line
              type="monotone"
              dataKey="avg_processing_time"
              stroke="#dc004e"
              name="Average Time (seconds)"
            />
          </LineChart>
        </Paper>
      </Grid>
    </Grid>
  );
};

export default TaskAnalytics;
